import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

// Improved error handler
const originalError = console.error;
console.error = (...args) => {
  if (/ResizeObserver|ResizeObserver loop limit exceeded/.test(args[0])) {
    return;
  }
  originalError.call(console, ...args);
};

// Custom ResizeObserver to avoid the loop limit error
class ResizeObserverWrapper {
  constructor(callback) {
    this.callback = callback;
    this.observer = new ResizeObserver((entries) => {
      window.requestAnimationFrame(() => {
        if (!Array.isArray(entries) || !entries.length) {
          return;
        }
        this.callback(entries);
      });
    });
  }

  observe(target) {
    this.observer.observe(target);
  }

  unobserve(target) {
    this.observer.unobserve(target);
  }

  disconnect() {
    this.observer.disconnect();
  }
}

// Replace the global ResizeObserver with our custom wrapper
window.ResizeObserver = ResizeObserverWrapper;

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
